import { AnimatePresence, motion } from 'framer-motion';
import { 
    Redirect, 
    Route, 
    Switch, 
    useLocation 
} from 'react-router-dom';

import LoadPage from './views/LoadPage';
import Checkout from './views/Checkout';
import Vehicles from './views/Vehicles';
import GoodBuy from './views/GoodBuy';


const Routes = () => {
    const location = useLocation();
    const pageVariants = {
        initial: {
            opacity: 0,
            scale: 0.99
        },
        in: {
            opacity: 1,
            scale: 1
        },
        out: {
            opacity: 0,
            scale: 1.01
        }
    };
    const pageTransition = {
        type: "tween",
        ease: "anticipate",
        duration: 0.4
    }
    return (
        <AnimatePresence>
            <Switch>
                <Route path={[]}>
                    <Switch>
                        <motion.div initial="initial"
                                    animate="in"
                                    exit="out"
                                    variants={pageVariants}
                                    transition={pageTransition}
                        >
                            <Route path="/">
                                <LoadPage />
                            </Route>
                            <Route path="/vehicles">
                                <Vehicles/>
                            </Route>
                            <Route path="/Checkout">
                                <Checkout/>
                            </Route>
                            <Route path="/success">
                                <GoodBuy />
                            </Route>
                        </motion.div>
                    </Switch>
                </Route>
            </Switch>
        </AnimatePresence>
    )

}

export default Routes
